import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import "./SpecialPlace.css";

const SpecialPlace = () => {
    return (
        <div className="special-place">
            <Container>
                <Row className="d-flex align-items-center">
                    <Col md={6} xs={12}>
                        
                    </Col>
                    <Col md={6} xs={12}>
                       
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default SpecialPlace;
